import React from 'react'
import Card from '../components/Card'

const Favorites = ({favorites}) => {
  return (
    <div className="favorites p-40">
        <h2>Favorites</h2>
        {favorites && favorites.map(item =>(
            <Card items={item}/>
        ))}
                
    </div>
  )
}

export default Favorites
